import React from "react";
import { BrowserRouter } from "react-router-dom";
import Router from "./routes/Router";
import MThemeProvider from "./theme/MThemeProvider";

function App() {
  return (
    <BrowserRouter>
      {/* <MThemeProvider> */}
        <Router />
      {/* </MThemeProvider> */}
    </BrowserRouter>
  );
}

export default App;
